DROP TABLE IF EXISTS "Trades" CASCADE;
DROP TABLE IF EXISTS "PriceHistories" CASCADE;
DROP TABLE IF EXISTS "ProtectedMatches" CASCADE;
DROP TABLE IF EXISTS "Offers" CASCADE;
DROP TABLE IF EXISTS "Entries" CASCADE;
DROP TABLE IF EXISTS "NFLPlayers" CASCADE;
