CREATE TABLE IF NOT EXISTS "Users" ("id"  SERIAL , "email" VARCHAR(255) NOT NULL UNIQUE, "verified" BOOLEAN DEFAULT false, "pwHash" VARCHAR(255) NOT NULL, "name" VARCHAR(255) NOT NULL, "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("id"));
SELECT i.relname AS name, ix.indisprimary AS primary, ix.indisunique AS unique, ix.indkey AS indkey, array_agg(a.attnum) as column_indexes, array_agg(a.attname) AS column_names, pg_get_indexdef(ix.indexrelid) AS definition FROM pg_class t, pg_class i, pg_index ix, pg_attribute a WHERE t.oid = ix.indrelid AND i.oid = ix.indexrelid AND a.attrelid = t.oid AND t.relkind = 'r' and t.relname = 'Users' GROUP BY i.relname, ix.indexrelid, ix.indisprimary, ix.indisunique, ix.indkey ORDER BY i.relname;
CREATE INDEX "IX_Users" ON "Users" ("email");
CREATE TABLE IF NOT EXISTS "Contests" ("id"   SERIAL , "name" VARCHAR(255) NOT NULL, "nflweek" INTEGER NOT NULL, "budget" INTEGER NOT NULL, "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("id"));
SELECT i.relname AS name, ix.indisprimary AS primary, ix.indisunique AS unique, ix.indkey AS indkey, array_agg(a.attnum) as column_indexes, array_agg(a.attname) AS column_names, pg_get_indexdef(ix.indexrelid) AS definition FROM pg_class t, pg_class i, pg_index ix, pg_attribute a WHERE t.oid = ix.indrelid AND i.oid = ix.indexrelid AND a.attrelid = t.oid AND t.relkind = 'r' and t.relname = 'Contests' GROUP BY i.relname, ix.indexrelid, ix.indisprimary, ix.indisunique, ix.indkey ORDER BY i.relname;
CREATE TABLE IF NOT EXISTS "NFLPositions" ("id" INTEGER , "name" VARCHAR(255) NOT NULL, "canflex" BOOLEAN NOT NULL DEFAULT false, "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("id"));
SELECT i.relname AS name, ix.indisprimary AS primary, ix.indisunique AS unique, ix.indkey AS indkey, array_agg(a.attnum) as column_indexes, array_agg(a.attname) AS column_names, pg_get_indexdef(ix.indexrelid) AS definition FROM pg_class t, pg_class i, pg_index ix, pg_attribute a WHERE t.oid = ix.indrelid AND i.oid = ix.indexrelid AND a.attrelid = t.oid AND t.relkind = 'r' and t.relname = 'NFLPositions' GROUP BY i.relname, ix.indexrelid, ix.indisprimary, ix.indisunique, ix.indkey ORDER BY i.relname;
CREATE TABLE IF NOT EXISTS "NFLTeams" ("id" INTEGER , "location" VARCHAR(255), "name" VARCHAR(255), "abr" VARCHAR(255) NOT NULL UNIQUE, "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("id"));
SELECT i.relname AS name, ix.indisprimary AS primary, ix.indisunique AS unique, ix.indkey AS indkey, array_agg(a.attnum) as column_indexes, array_agg(a.attname) AS column_names, pg_get_indexdef(ix.indexrelid) AS definition FROM pg_class t, pg_class i, pg_index ix, pg_attribute a WHERE t.oid = ix.indrelid AND i.oid = ix.indexrelid AND a.attrelid = t.oid AND t.relkind = 'r' and t.relname = 'NFLTeams' GROUP BY i.relname, ix.indexrelid, ix.indisprimary, ix.indisunique, ix.indkey ORDER BY i.relname;
CREATE TABLE IF NOT EXISTS "NFLGames" ("week" INTEGER NOT NULL , "HomeId" INTEGER NOT NULL  REFERENCES "NFLTeams" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "AwayId" INTEGER NOT NULL  REFERENCES "NFLTeams" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "phase" VARCHAR(255) DEFAULT 'post', "startTime" INTEGER NOT NULL, "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("week","HomeId","AwayId"));
SELECT i.relname AS name, ix.indisprimary AS primary, ix.indisunique AS unique, ix.indkey AS indkey, array_agg(a.attnum) as column_indexes, array_agg(a.attname) AS column_names, pg_get_indexdef(ix.indexrelid) AS definition FROM pg_class t, pg_class i, pg_index ix, pg_attribute a WHERE t.oid = ix.indrelid AND i.oid = ix.indexrelid AND a.attrelid = t.oid AND t.relkind = 'r' and t.relname = 'NFLGames' GROUP BY i.relname, ix.indexrelid, ix.indisprimary, ix.indisunique, ix.indkey ORDER BY i.relname;
CREATE TABLE IF NOT EXISTS "NFLPlayers" ("id" INTEGER , "name" VARCHAR(255) NOT NULL, "jersey" INTEGER DEFAULT 0, "preprice" INTEGER, "postprice" INTEGER, "NFLPositionId" INTEGER NOT NULL REFERENCES "NFLPositions" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "NFLTeamId" INTEGER NOT NULL REFERENCES "NFLTeams" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "active" BOOLEAN DEFAULT true, "injuryStatus" VARCHAR(255) DEFAULT NULL, "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("id"));
SELECT i.relname AS name, ix.indisprimary AS primary, ix.indisunique AS unique, ix.indkey AS indkey, array_agg(a.attnum) as column_indexes, array_agg(a.attname) AS column_names, pg_get_indexdef(ix.indexrelid) AS definition FROM pg_class t, pg_class i, pg_index ix, pg_attribute a WHERE t.oid = ix.indrelid AND i.oid = ix.indexrelid AND a.attrelid = t.oid AND t.relkind = 'r' and t.relname = 'NFLPlayers' GROUP BY i.relname, ix.indexrelid, ix.indisprimary, ix.indisunique, ix.indkey ORDER BY i.relname;
CREATE INDEX "IX_NFLPlayer_Active" ON "NFLPlayers" ("active", "NFLTeamId") WHERE "active" = true;
CREATE TABLE IF NOT EXISTS "Entries" ("pointtotal" INTEGER NOT NULL, "UserId" INTEGER  REFERENCES "Users" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "ContestId" INTEGER  REFERENCES "Contests" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "QB1" INTEGER REFERENCES "NFLPlayers" ("id"), "RB1" INTEGER REFERENCES "NFLPlayers" ("id"), "RB2" INTEGER REFERENCES "NFLPlayers" ("id"), "WR1" INTEGER REFERENCES "NFLPlayers" ("id"), "WR2" INTEGER REFERENCES "NFLPlayers" ("id"), "TE1" INTEGER REFERENCES "NFLPlayers" ("id"), "FLEX1" INTEGER REFERENCES "NFLPlayers" ("id"), "FLEX2" INTEGER REFERENCES "NFLPlayers" ("id"), "K1" INTEGER REFERENCES "NFLPlayers" ("id"), "DEF1" INTEGER REFERENCES "NFLPlayers" ("id"), "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("UserId","ContestId"));
SELECT i.relname AS name, ix.indisprimary AS primary, ix.indisunique AS unique, ix.indkey AS indkey, array_agg(a.attnum) as column_indexes, array_agg(a.attname) AS column_names, pg_get_indexdef(ix.indexrelid) AS definition FROM pg_class t, pg_class i, pg_index ix, pg_attribute a WHERE t.oid = ix.indrelid AND i.oid = ix.indexrelid AND a.attrelid = t.oid AND t.relkind = 'r' and t.relname = 'Entries' GROUP BY i.relname, ix.indexrelid, ix.indisprimary, ix.indisunique, ix.indkey ORDER BY i.relname;
CREATE TABLE IF NOT EXISTS "Offers" ("id" UUID , "isbid" BOOLEAN NOT NULL, "price" INTEGER NOT NULL, "protected" BOOLEAN NOT NULL DEFAULT false, "filled" BOOLEAN NOT NULL DEFAULT false, "cancelled" BOOLEAN NOT NULL DEFAULT false, "UserId" INTEGER NOT NULL REFERENCES "Users" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "ContestId" INTEGER NOT NULL REFERENCES "Contests" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "NFLPlayerId" INTEGER NOT NULL REFERENCES "NFLPlayers" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("id"));
SELECT i.relname AS name, ix.indisprimary AS primary, ix.indisunique AS unique, ix.indkey AS indkey, array_agg(a.attnum) as column_indexes, array_agg(a.attname) AS column_names, pg_get_indexdef(ix.indexrelid) AS definition FROM pg_class t, pg_class i, pg_index ix, pg_attribute a WHERE t.oid = ix.indrelid AND i.oid = ix.indexrelid AND a.attrelid = t.oid AND t.relkind = 'r' and t.relname = 'Offers' GROUP BY i.relname, ix.indexrelid, ix.indisprimary, ix.indisunique, ix.indkey ORDER BY i.relname;
CREATE UNIQUE INDEX "IX_Offer-OneActive" ON "Offers" ("ContestId", "UserId", "NFLPlayerId") WHERE "filled" = false AND "cancelled" = false;
CREATE INDEX "IX_Offer-Active" ON "Offers" ("ContestId", "UserId", "NFLPlayerId", "createdAt" ASC) WHERE "filled" = false AND "cancelled" = false;
CREATE TABLE IF NOT EXISTS "PriceHistories" ("id"   SERIAL , "lastTradePrice" INTEGER, "ContestId" INTEGER NOT NULL REFERENCES "Contests" ("id"), "NFLPlayerId" INTEGER NOT NULL REFERENCES "NFLPlayers" ("id"), "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("id"));
SELECT i.relname AS name, ix.indisprimary AS primary, ix.indisunique AS unique, ix.indkey AS indkey, array_agg(a.attnum) as column_indexes, array_agg(a.attname) AS column_names, pg_get_indexdef(ix.indexrelid) AS definition FROM pg_class t, pg_class i, pg_index ix, pg_attribute a WHERE t.oid = ix.indrelid AND i.oid = ix.indexrelid AND a.attrelid = t.oid AND t.relkind = 'r' and t.relname = 'PriceHistories' GROUP BY i.relname, ix.indexrelid, ix.indisprimary, ix.indisunique, ix.indkey ORDER BY i.relname;
CREATE TABLE IF NOT EXISTS "ProtectedMatches" ("existingId" UUID  REFERENCES "Offers" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "newId" UUID  REFERENCES "Offers" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("existingId","newId"));
SELECT i.relname AS name, ix.indisprimary AS primary, ix.indisunique AS unique, ix.indkey AS indkey, array_agg(a.attnum) as column_indexes, array_agg(a.attname) AS column_names, pg_get_indexdef(ix.indexrelid) AS definition FROM pg_class t, pg_class i, pg_index ix, pg_attribute a WHERE t.oid = ix.indrelid AND i.oid = ix.indexrelid AND a.attrelid = t.oid AND t.relkind = 'r' and t.relname = 'ProtectedMatches' GROUP BY i.relname, ix.indexrelid, ix.indisprimary, ix.indisunique, ix.indkey ORDER BY i.relname;
CREATE TABLE IF NOT EXISTS "Trades" ("price" INTEGER NOT NULL, "bidId" UUID NOT NULL  REFERENCES "Offers" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "askId" UUID NOT NULL  REFERENCES "Offers" ("id") ON DELETE NO ACTION ON UPDATE CASCADE, "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, PRIMARY KEY ("bidId","askId"));
